  \"2015-01-22T15:57:32.272148\",\n\t\"name\": \"coc-areas\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"The purpose of the Continuum of Care (CoC) Homeless Assistance
  Programs is to reduce the incidence of homelessness in CoC communities by assisting
  homeless individuals and families in quickly transitioning to self-sufficiency and
  permanent housing. The programs administered by HUD award funds competitively and
  require the development of a Continuum of Care system in the community where assistance
  is being sought. A continuum of care system is designed to address the critical
  problem of homelessness through a coordinated community-based process of identifying
  needs and building a system to address those needs. The approach is predicated on
  the understanding that homelessness is not caused merely by a lack of shelter, but
  involves a variety of underlying, unmet needs - physical, economic, and social.
  Funds are granted based on the competition following the Notice of Funding Availability
  (NOFA).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
